t// require a valid price\r\n\t\trequire (_price > 0, "ERROR: invalid value for weapon price!");\r\n\r\n\t\t// increment product count\r\n\t\tproductCount ++;\r\n\r\n\t\t// create the product\r\n\t\tproducts[productCount] = Product(productCount, _name, _price, msg.sender, false);\r\n\r\n\t\t// trigger an event\r\n\t\temit ProductCreated(productCount, _name, _price, msg.sender, false);\r\n\t}\r\n\r\n\tfunction purchaseProduct (uint _id) public payable {\r\n\t\t// fetch the product\r\n\t\tProduct memory _product = products[_id];\r\n\r\n\t\t// fetch the product owner\'s address\r\n\t\taddress payable _seller = _product.owner;\r\n\r\n\t\t// require that the product has a valid id\r\n\t\trequire (_product.id > 0 && _product.id <= productCount, "ERROR: invalid weapon id!");\r\n\r\n\t\t// require that there is enough ether for the transaction\r\n\t\trequire (msg.value >= _product.price, "ERROR: insufficient funds!");\r\n\r\n\t\t// require that the buyer is not the seller\r\n\t\trequire (_seller != msg.sender, "ERROR: this is the seller\'s account!");\r\n\r\n\t\t// transfer product ownership to the buyer\r\n\t\t_product.owner = msg.sender;\r\n\r\n\t\t// mark product as purchased\r\n\t\t_product.purchased = true;\r\n\r\n\t\t// update product in the mapping\r\n\t\tproducts[_id] = _product;\r\n\r\n\t\t// pay the seller by sending them ether\r\n\t\taddress(_seller).transfer(msg.value);\r\n\r\n\t\t// trigger an event\r\n\t\temit ProductPurchased(productCount, _product.name, _product.price, msg.sender, true);\r\n\t}\r\n}\r\n\r\n',sourcePath:"F:\\projects\\ethereum\\i_undeadblocks\\src\\contracts\\Marketplace.sol",ast:{absolutePath:"project:/src/contracts/Marketplace.sol",exportedSymbols:{Marketplace:[189]},id:190,nodeType:"SourceUnit",nodes:[{id:1,literals:["solidity",">=","0.4",".21","<","8.10",".0"],nodeType:"PragmaDirective",src:"0:33:0"},{baseContracts:[],contractDependencies:[],contractKind:"contract",documentation:null,fullyImplemented:!0,id:189,linearizedBaseContracts:[189